import React from 'react';
import './index.css';
import Color from './Color';

function Events(){
    return(
        <>
        <div className='set_button' style={Color[0]}>
            <button className='eventButton' style={Color[1]}>Click</button>
        </div>
        </>
    )
}

export default Events;
